}
    .mini-cart-product-list li:last-child .mini-cart-product-card-wrapper  {
    border-bottom-color: transparent;
}
    .mini-cart-product-card {
    position: relative;
    overflow: hidden;
}
.mini-cart-product-card article {
    margin-bottom: 0;
}

