  #header-search-input::placeholder {
    color: #66676E;
  }
  @media screen and (min-width: 1024px) {
    #header-search-container {
      margin-bottom: -1px;
      min-width: 260px;
    }
    #header-search-container > form {
      max-width: 260px;
    }
    #header-search-container.desktopSearchExpanded > form {
      max-width: 580px;
    }
    #header-search-container.desktopSearchExpanded > form > #search-input-container {
      width: 580px;
    }
    #header-search-container > form > #search-input-container > div {
      max-width: 580px;
    }
  }
  @media screen and (max-width: 1023px) {
    #header-search-container > form {
      width: 100%;
    }
  }

  #header-search-dropdown-container {
    max-width: inherit;
    @media screen and (min-width: 1024px) {
        max-height: calc(100vh - 140px);
        max-width: inherit;
        border-bottom-width: 1px;
        border-left-width: 1px;
        border-right-width: 1px;
        overflow-y: auto;
      }
  }

  @media screen and (min-width: 1024px) {
    #header-search-container > form > #search-input-container > div > div:nth-of-type(1) > div {
      max-height: 2.75rem;
      height: 100%;
    }
  }
  @media screen and (max-width: 1023px) {
    #header-search-container > form > #search-input-container > div > div:nth-of-type(1) > div {
        box-shadow: none !important;
        border-width: var(--border-width-s);
        border-color: var(--color-border-secondary);
        border-style: solid;
        border-bottom: none;
        border-left: none;
        max-height: none;
      }
  }

  @media screen and (min-width: 1024px) {
    .desktopHeaderSearchTransition {
      transition: top .25s linear,transform .25s ease,-webkit-transform .25s ease;
    }
    .desktopSearchExpanded {
      transform: translateX(-50vw) translateX(calc(580px/2)) translateX(calc(var(--grid-margin) - var(--grid-gutter)/2)) translateX(8px);
    }
  }
  @media screen and (min-width: 1280px) {
    .desktopSearchExpanded {
      transform: translateX(-50vw) translateX(calc(580px/2)) translateX(calc(50vw - var(--grid-max-width)/2 + var(--grid-margin)*2/2)) translateX(8px);
    }
  }
  @media (prefers-reduced-motion) {
    .desktopHeaderSearchTransition {
      transition: none;
    }
  }

  @media screen and (max-width: 1023px) {
    .mWebHeaderSearchAnimation {
      animation: mWebHeaderSearchSlideUp .25s ease-in;
      transform: translateY(-62px);
    }
    @keyframes mWebHeaderSearchSlideUp {
        /*  iOS Safari fix: hiding caret not translating during animation */
        0% {
          transform: translateY(0);
          caret-color: transparent;
        }
        100% {
          transform: translateY(-62px);
          caret-color: transparent;
        }
    }
  }
  @media (prefers-reduced-motion) {
    .mWebHeaderSearchAnimation {
      animation: none;
    }
  }
